<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
<meta http-equiv="X-Content-Type-Options" content="nosniff">
<meta http-equiv="Referrer-Policy" content="no-referrer">
<meta http-equiv="Permissions-Policy" content="accelerometer=(), camera=(), geolocation=(), gyroscope=(), magnetometer=(), microphone=(), payment=(), usb=(), interest-cohort=()">
<meta http-equiv="Content-Security-Policy" content="default-src 'none'; script-src 'wasm-unsafe-eval' 'unsafe-inline'; style-src 'unsafe-inline'; img-src data: blob:; form-action 'none'; base-uri 'none';">
<title>BaseCrypt</title>
<style>
:root{--bg:#0a0a0a;--fg:#e8e8e8;--accent:#fff;--border:#444;--tr:.15s;--danger:#f44;--success:#4f4}
*{box-sizing:border-box;margin:0;padding:0}
body{font-family:'SF Mono',Menlo,Consolas,monospace;background:var(--bg);color:var(--fg);padding:1rem;display:flex;flex-direction:column;align-items:center;min-height:100vh;-webkit-font-smoothing:antialiased}
.c{width:min(800px,100%);flex:1;display:flex;flex-direction:column}
header{display:flex;justify-content:space-between;align-items:flex-start;width:100%;max-width:800px;margin-bottom:.5rem}
header h1{font-size:1.6rem;font-weight:400}
header p{font-size:.9rem;color:#aaa;margin-top:.2rem}
.tabs{display:flex;gap:8px;margin:12px 0}
.tab{padding:.4rem .8rem;border-radius:6px;background:transparent;color:#aaa;cursor:pointer;transition:var(--tr);font-size:.95rem;user-select:none}
.tab:hover{color:var(--fg)}
.tab.active{background:var(--border);color:var(--fg)}
.editor-area{flex:1;display:flex;flex-direction:column;position:relative}
.note-field{width:100%;font-family:inherit;font-size:1rem;line-height:1.5;color:var(--fg);background:transparent;border:none;outline:none;white-space:pre-wrap;resize:none;padding:0;flex:1;min-height:60vh;max-height:60vh}
.password-field{width:100%;font-family:inherit;font-size:1rem;color:var(--fg);background:transparent;border:1px solid var(--border);border-radius:6px;padding:.6rem .75rem;outline:none;line-height:1.3;height:auto;max-height:3rem;}
#note-counter{position:absolute;right:8px;bottom:8px;color:#777;font-size:.8rem;pointer-events:none}
.controls{display:flex;gap:8px;margin-top:12px;align-items:center;flex-wrap:wrap}
.btn{padding:.5rem 1rem;border:1px solid var(--border);background:transparent;color:var(--fg);border-radius:6px;cursor:pointer;transition:var(--tr);font-size:.9rem;min-width:80px;text-align:center}
.btn:hover{background:var(--border)}
.btn.primary{background:var(--accent);color:var(--bg);border:none;font-weight:500}
.btn.primary:hover{background:#ddd}
.btn:disabled{opacity:.5;cursor:not-allowed}
.btn.small{padding:.4rem .7rem;font-size:.85rem;min-width:auto}
#decrypted-text,#read-decrypted-text{white-space:pre-wrap;overflow-wrap:break-word;background:transparent;padding:.8rem;min-height:60vh;max-height:60vh;overflow:auto;font-family:inherit;font-size:1rem;line-height:1.5;border:none;outline:none}
.modal-bg{position:fixed;inset:0;display:flex;align-items:center;justify-content:center;background:rgba(0,0,0,.85);z-index:60;overflow:auto;padding:1rem}
.modal{width:min(520px,100%);max-width:90vw;max-height:90vh;overflow:auto;background:#111;border:1px solid var(--border);border-radius:10px;padding:1.5rem;position:relative;word-break:break-word;display:flex;flex-direction:column}
.modal h2{margin-bottom:1rem;font-size:1.15rem;font-weight:400}
.modal label{display:block;margin-bottom:.3rem;color:var(--fg);font-size:.9rem}
.modal .password-field{margin-bottom:12px}
.result-row{display:flex;align-items:center;gap:8px;background:#1a1a1a;padding:10px 12px;border-radius:6px;margin-bottom:10px}
.result-row label{margin:0;font-size:.75rem;color:#888;white-space:nowrap;min-width:55px}
.result-row .data{flex:1;font-size:.8rem;overflow:hidden;text-overflow:ellipsis;white-space:nowrap;user-select:all;color:var(--fg)}
.result-row .btn{flex-shrink:0}
.modal-buttons{display:flex;gap:8px;margin-top:1rem;justify-content:flex-end;flex-wrap:wrap}
.toast{position:fixed;left:14px;bottom:14px;background:#0d0d0d;padding:.5rem .8rem;border-radius:4px;border:1px solid #222;color:#999;z-index:99;font-size:.8rem;max-width:280px}
.spinner{display:inline-block;width:18px;height:18px;border:2.5px solid rgba(255,255,255,.15);border-top-color:var(--accent);border-radius:50%;animation:spin .6s linear infinite;margin-right:8px;vertical-align:middle}
@keyframes spin{0%{transform:rotate(0deg)}100%{transform:rotate(360deg)}}
.hidden{display:none!important}
.footer-links{font-size:.85rem;color:#888;margin-top:1rem;text-align:center;display:flex;justify-content:center;gap:10px;flex-wrap:wrap}
.footer-links a{color:var(--fg);text-decoration:underline;cursor:pointer}
.footer-links a:hover{text-decoration:none}
.bottom-buttons{display:flex;flex-direction:column;gap:6px;padding-top:.7rem;padding-bottom:.7rem;width:100%}
#open-view .controls{margin-bottom:.5rem}
.open-controls{display:flex;flex-direction:column;gap:12px}
.btn-row{display:flex;gap:8px;align-items:center;flex-wrap:wrap}
.read-section{display:flex;flex-direction:column;gap:12px}
.read-section textarea{min-height:80px;max-height:150px;resize:vertical;font-family:inherit;font-size:.85rem}
.text-container{position:relative;flex:1;display:flex;flex-direction:column-reverse}
.floating-btns{position:relative;display:flex;gap:6px;padding:8px 0;opacity:.6;transition:var(--tr);order:2}
.floating-btns:hover{opacity:1}
.floating-btns .btn{padding:.35rem .6rem;font-size:.8rem;min-width:auto;background:rgba(30,30,30,.9);border-color:var(--border)}
.floating-btns .btn:hover{background:var(--border)}
@media(min-width:768px){.c{padding:1rem 2rem}header h1{font-size:1.8rem}.tabs{margin:16px 0}.tab{padding:.5rem 1rem;font-size:1rem}.note-field{font-size:1.05rem;min-height:65vh;max-height:70vh}#decrypted-text,#read-decrypted-text{min-height:65vh;max-height:70vh;font-size:1.05rem;padding:1rem}.btn{padding:.55rem 1.2rem;font-size:.95rem}.password-field{font-size:1.05rem;padding:.7rem .9rem}.modal{padding:2rem;max-width:480px}}
@media(min-width:1024px){body{padding:2rem}.c{max-width:900px}header h1{font-size:2rem}.note-field{font-size:1.1rem}#decrypted-text,#read-decrypted-text{font-size:1.1rem}}
</style>
</head>
<body>
<div class="c">
<header>
<div>
<h1>BaseCrypt</h1>
</div>
</header>
<div class="tabs">
<div class="tab active" data-view="create">Create</div>
<div class="tab" data-view="open">Open</div>
<div class="tab" data-view="read">Read</div>
</div>
<div id="create-view">
<div class="editor-area">
<textarea id="note" class="note-field" placeholder="Write something..." spellcheck="false" autocomplete="off" autocapitalize="off" autocorrect="off" data-gramm="false" disabled></textarea>
<div id="note-counter">0/30000</div>
</div>
<div class="bottom-buttons">
<div class="controls" style="justify-content:center;">
<button id="open-pass-modal" class="btn primary" style="max-width:280px;width:100%;" disabled>Lock &amp; Generate Link</button>
</div>
<div class="footer-links">
<a id="download-btn">Download offline HTML</a>
<span>|</span>
<a href="https://github.com/basecrypt/basecrypt.github.io" target="_blank" rel="noopener noreferrer">GitHub</a>
</div>
</div>
</div>
<div id="open-view" class="hidden">
<div class="open-controls">
<input id="pass-open" class="password-field" type="password" placeholder="Enter passphrase to unlock" autocomplete="off" spellcheck="false" disabled>
<div class="btn-row">
<button id="decrypt-btn" class="btn primary" disabled>Unlock</button>
</div>
</div>
<div class="text-container">
<div id="open-floating-btns" class="floating-btns hidden">
<button id="copy-decrypted" class="btn small">Copy</button>
<button id="open-reset-btn" class="btn small">Reset</button>
</div>
<div id="decrypted-text" class="hidden"></div>
</div>
</div>
<div id="read-view" class="hidden">
<div class="read-section">
<textarea id="read-portable-data" class="password-field" placeholder="Paste portable encrypted data here..." spellcheck="false" autocomplete="off" disabled></textarea>
<input id="pass-read" class="password-field hidden" type="password" placeholder="Enter passphrase to unlock" autocomplete="off" spellcheck="false" disabled>
<div class="btn-row">
<button id="read-lock-btn" class="btn primary" disabled>Load</button>
<button id="read-decrypt-btn" class="btn primary hidden" disabled>Unlock</button>
</div>
</div>
<div class="text-container">
<div id="read-floating-btns" class="floating-btns hidden">
<button id="copy-read-decrypted" class="btn small">Copy</button>
<button id="read-reset-btn" class="btn small">Reset</button>
</div>
<div id="read-decrypted-text" class="hidden"></div>
</div>
</div>
</div>
<div id="pass-modal-bg" class="modal-bg hidden">
<div class="modal">
<h2>Set passphrase</h2>
<label for="pass-create">Passphrase</label>
<input id="pass-create" class="password-field" type="password" placeholder="Enter passphrase" autocomplete="new-password" spellcheck="false">
<label for="pass-confirm" style="margin-top:12px">Confirm passphrase</label>
<input id="pass-confirm" class="password-field" type="password" placeholder="Confirm passphrase" autocomplete="new-password" spellcheck="false">
<div class="modal-buttons">
<button id="cancel-pass" class="btn small">Cancel</button>
<button id="confirm-pass" class="btn primary">Lock</button>
</div>
</div>
</div>
<div id="link-modal-bg" class="modal-bg hidden">
<div class="modal">
<h2>Your secure note</h2>
<div id="result-url-row" class="result-row">
<label>URL</label>
<div id="result-url" class="data"></div>
<button id="copy-link-btn" class="btn small">Copy</button>
</div>
<div id="result-data-row" class="result-row">
<label>Data</label>
<div id="result-data" class="data"></div>
<button id="copy-data-btn" class="btn small">Copy</button>
</div>
<div class="modal-buttons">
<button id="share-link-btn" class="btn small">Share</button>
<button id="close-link-modal" class="btn primary">Done</button>
</div>
</div>
</div>

						}
						const toCopy = src.subarray(0, dst.length);

		async run(instance) {

			}

			});

			});

		_resume() {

			}

			}

<script>"use strict";
(()=>{
const $=s=>document.querySelector(s);
const $$=s=>document.querySelectorAll(s);
let maxLen=30000;
let toastTimeout=null;let toastEl=null;const killToast=()=>{if(toastEl){toastEl.remove();toastEl=null}if(toastTimeout){clearTimeout(toastTimeout);toastTimeout=null}};
const toast=m=>{killToast();const t=document.createElement("div");t.className="toast";t.textContent=m;document.body.appendChild(t);toastEl=t;toastTimeout=setTimeout(()=>{if(toastEl===t)t.remove();toastEl=null;toastTimeout=null},2200)};
const secureWipeInput=el=>{if(!el)return;el.value="";el.setAttribute("value","")};
const getNoteFromHash=()=>{const h=location.hash;if(!h||h.length<7)return null;const m=h.match(/^#note=(.+)$/);if(!m)return null;try{return decodeURIComponent(m[1])}catch(e){return null}};
let readPortableData="";
const views=["create","open","read"];
const clearViewData=()=>{secureWipeInput($("#pass-open"));secureWipeInput($("#pass-read"));secureWipeInput($("#read-portable-data"));$("#decrypted-text").textContent="";$("#decrypted-text").classList.add("hidden");$("#read-decrypted-text").textContent="";$("#read-decrypted-text").classList.add("hidden");$("#open-floating-btns").classList.add("hidden");$("#read-floating-btns").classList.add("hidden");$("#read-portable-data").classList.remove("hidden");$("#read-lock-btn").classList.remove("hidden");$("#pass-read").classList.add("hidden");$("#read-decrypt-btn").classList.add("hidden");readPortableData=""};
const switchTab=(v)=>{views.forEach(x=>{const el=$("#"+x+"-view");const tab=$('[data-view="'+x+'"]');if(x===v){el.classList.remove("hidden");tab.classList.add("active")}else{el.classList.add("hidden");tab.classList.remove("active")}})};
$$(".tab").forEach(tab=>{tab.onclick=()=>{const v=tab.dataset.view;const currentView=views.find(x=>!$("#"+x+"-view").classList.contains("hidden"));if(v===currentView)return;if(v==="create"){if(typeof window.goCryptoSecureClear==="function"){window.goCryptoSecureClear();return}location.replace(location.pathname);return}clearViewData();switchTab(v)}});
const noteEl=$("#note");
const counterEl=$("#note-counter");
noteEl.oninput=()=>{const len=[...noteEl.value].length;counterEl.textContent=len+"/"+maxLen;counterEl.style.color=len>maxLen?"var(--danger)":"#777"};
$("#open-pass-modal").onclick=()=>{const note=noteEl.value;if(!note.trim()){toast("Write something first");return}if([...note].length>maxLen){toast("Text too long");return}$("#pass-modal-bg").classList.remove("hidden");$("#pass-create").focus()};
const passModal=$("#pass-modal-bg");
const linkModal=$("#link-modal-bg");
$("#cancel-pass").onclick=()=>{secureWipeInput($("#pass-create"));secureWipeInput($("#pass-confirm"));passModal.classList.add("hidden")};
passModal.onclick=e=>{if(e.target===passModal){secureWipeInput($("#pass-create"));secureWipeInput($("#pass-confirm"));passModal.classList.add("hidden")}};
linkModal.onclick=e=>{if(e.target===linkModal){linkModal.classList.add("hidden");secureWipeAndReload()}};
const secureWipeAndReload=()=>{secureWipeInput($("#note"));secureWipeInput($("#pass-open"));secureWipeInput($("#pass-read"));secureWipeInput($("#pass-create"));secureWipeInput($("#pass-confirm"));secureWipeInput($("#read-portable-data"));$("#decrypted-text").textContent="";$("#read-decrypted-text").textContent="";if(typeof window.goCryptoSecureReload==="function"){window.goCryptoSecureReload()}else{location.replace(location.pathname)}};
$("#confirm-pass").onclick=async()=>{const note=noteEl.value;const pass=$("#pass-create").value;const confirm=$("#pass-confirm").value;if(!pass){toast("Enter passphrase");return}if(pass!==confirm){toast("Passphrases don't match");return}const btn=$("#confirm-pass");const origText=btn.textContent;btn.disabled=true;btn.innerHTML="<span class=\"spinner\"></span> Encrypting...";await new Promise(r=>setTimeout(r,50));try{if(typeof window.goCryptoEncrypt!=="function")throw new Error("Engine not ready");const result=window.goCryptoEncrypt(note,pass);secureWipeInput($("#pass-create"));secureWipeInput($("#pass-confirm"));if(result.error){toast(result.result||"Encryption failed");passModal.classList.add("hidden")}else{passModal.classList.add("hidden");const encData=result.result;const urlEl=$("#result-url");const dataEl=$("#result-data");const newUrl=new URL(location.href);newUrl.hash="note="+encodeURIComponent(encData);const linkStr=newUrl.toString();urlEl.textContent=linkStr;dataEl.textContent=encData;$("#copy-link-btn").onclick=()=>{navigator.clipboard.writeText(linkStr).then(()=>toast("Link copied")).catch(()=>toast("Copy failed"))};$("#copy-data-btn").onclick=()=>{navigator.clipboard.writeText(encData).then(()=>toast("Data copied")).catch(()=>toast("Copy failed"))};$("#share-link-btn").onclick=()=>{if(navigator.share)navigator.share({title:"BaseCrypt",url:linkStr}).catch(()=>{});else navigator.clipboard.writeText(linkStr).then(()=>toast("Link copied")).catch(()=>toast("Copy failed"))};linkModal.classList.remove("hidden")}}catch(err){toast("Failed");passModal.classList.add("hidden")}finally{btn.textContent=origText;btn.disabled=false}};
$("#close-link-modal").onclick=()=>{linkModal.classList.add("hidden");secureWipeAndReload()};
$("#download-btn").onclick=()=>{secureWipeInput($("#pass-create"));secureWipeInput($("#pass-confirm"));secureWipeInput($("#pass-open"));secureWipeInput($("#pass-read"));$("#decrypted-text").textContent="";$("#read-decrypted-text").textContent="";const clone=document.documentElement.cloneNode(true);clone.querySelectorAll("#decrypted-text,#read-decrypted-text").forEach(el=>el.textContent="");clone.querySelectorAll("input[type=password],textarea").forEach(el=>{el.value="";el.removeAttribute("value")});const fullHTML="<!DOCTYPE html>\n"+clone.outerHTML;const blob=new Blob([fullHTML],{type:"text/html;charset=utf-8"});const url=URL.createObjectURL(blob);const a=document.createElement("a");a.href=url;a.download="basecrypt-offline.html";document.body.appendChild(a);a.click();document.body.removeChild(a);setTimeout(()=>URL.revokeObjectURL(url),1000);toast("Downloaded")};
const tryDecrypt=async(data,pass,textEl,copyBtn)=>{if(!pass){toast("Enter passphrase");return false}if(!data){toast("No encrypted data");return false}if(data.length>2*1024*1024){toast("Data too large");return false}const btn=textEl.id==="decrypted-text"?$("#decrypt-btn"):$("#read-decrypt-btn");const floatingBtns=textEl.id==="decrypted-text"?$("#open-floating-btns"):$("#read-floating-btns");const origText=btn.textContent;btn.disabled=true;btn.innerHTML="<span class=\"spinner\"></span> Unlocking...";await new Promise(r=>setTimeout(r,50));try{if(typeof window.goCryptoDecrypt!=="function")throw new Error("Engine not ready");const result=window.goCryptoDecrypt(data,pass);if(textEl.id==="decrypted-text")secureWipeInput($("#pass-open"));else secureWipeInput($("#pass-read"));if(result.error){toast("Wrong passphrase or corrupted data");floatingBtns.classList.add("hidden");textEl.classList.add("hidden");return false}else{const pt=result.result;textEl.textContent=pt;textEl.classList.remove("hidden");if(pt.trim().length>0){copyBtn.onclick=()=>{navigator.clipboard.writeText(pt).then(()=>toast("Copied")).catch(()=>toast("Copy failed"))}}toast("Unlocked");return true}}catch(err){floatingBtns.classList.add("hidden");textEl.classList.add("hidden");toast("Failed");return false}finally{btn.textContent=origText;btn.disabled=false}};
$("#decrypt-btn").onclick=async()=>{const pass=$("#pass-open").value;const data=getNoteFromHash();if(!data){toast("No data in URL hash");return}const ok=await tryDecrypt(data,pass,$("#decrypted-text"),$("#copy-decrypted"));if(ok)$("#open-floating-btns").classList.remove("hidden")};
$("#open-reset-btn").onclick=()=>{if(typeof window.goCryptoSecureClear==="function"){window.goCryptoSecureClear();return}location.replace(location.pathname)};
$("#read-lock-btn").onclick=()=>{let data=$("#read-portable-data").value.trim();if(!data){toast("Paste portable data first");return}if(data.length>2*1024*1024){toast("Data too large");return}if(data.includes("#note=")){try{const parts=data.split("#note=");if(parts.length>1){data=decodeURIComponent(parts[1].split("&")[0].split("#")[0])}}catch(e){}}readPortableData=data;secureWipeInput($("#read-portable-data"));$("#read-portable-data").classList.add("hidden");$("#read-lock-btn").classList.add("hidden");$("#pass-read").classList.remove("hidden");$("#pass-read").disabled=false;$("#read-decrypt-btn").classList.remove("hidden");$("#read-decrypt-btn").disabled=false;$("#pass-read").focus()};
$("#read-decrypt-btn").onclick=async()=>{const pass=$("#pass-read").value;if(!readPortableData){toast("Load data first");return}const ok=await tryDecrypt(readPortableData,pass,$("#read-decrypted-text"),$("#copy-read-decrypted"));if(ok)$("#read-floating-btns").classList.remove("hidden")};
$("#read-reset-btn").onclick=()=>{if(typeof window.goCryptoSecureClear==="function"){window.goCryptoSecureClear();return}location.replace(location.pathname)};
const checkHashAndSwitch=()=>{const data=getNoteFromHash();if(data){document.querySelector('[data-view="open"]').click()}};
async function loadWasm(){try{const wasmEl=document.getElementById("wasm-base64");if(!wasmEl)throw new Error("WASM element not found");const wasmB64=wasmEl.textContent.trim();if(!wasmB64||wasmB64.length<100)throw new Error("WASM not embedded");const wasmBinary=Uint8Array.from(atob(wasmB64),c=>c.charCodeAt(0));const go=new Go();const result=await WebAssembly.instantiate(wasmBinary,go.importObject);go.run(result.instance);let attempts=0;while(!window.goCryptoReady&&attempts<50){await new Promise(r=>setTimeout(r,100));attempts++}if(!window.goCryptoReady)throw new Error("WASM init timeout");if(typeof window.goCryptoMaxLen==="function")maxLen=window.goCryptoMaxLen();noteEl.maxLength=maxLen*4;counterEl.textContent="0/"+maxLen;noteEl.disabled=false;$("#open-pass-modal").disabled=false;$("#pass-open").disabled=false;$("#decrypt-btn").disabled=false;$("#read-portable-data").disabled=false;$("#read-lock-btn").disabled=false;checkHashAndSwitch()}catch(e){toast("Engine failed to load")}}
loadWasm();["#pass-open","#pass-read","#pass-create","#pass-confirm","#read-portable-data"].forEach(s=>{const el=$(s);if(el){el.addEventListener("input",killToast);el.addEventListener("focus",killToast)}})
})();
</script>
